// Import the necessary styles globally
import '@telegram-apps/telegram-ui/dist/styles.css';

// Import components from the library
import { AppRoot, Cell, List, Section, Chip, Avatar } from '@telegram-apps/telegram-ui';
import {MyTabbar} from './components/MyTabbar';

import { useTelegram } from '@twa-dev/sdk-react';


// Example data for rendering list cells
const cellsTexts = ['Chat Settings', 'Data and Storage', 'Devices'];

export const App = () => (
  <AppRoot>
<List style={{
    background: 'var(--tgui--secondary_bg_color)',
    padding: 20
  }}>
      <div style={{
      display: 'flex',
      gap: 8
    }}>
        <Chip mode="elevated" before={<Avatar size={20} />}>
          Elevated
        </Chip>
        <Chip mode="mono" before={<Avatar size={20} />}>
          Mono
        </Chip>
        <Chip mode="outline" before={<Avatar size={20} />}>
          Outline
        </Chip>
      </div>
    </List>
    <MyTabbar/>

  </AppRoot>
);

export default App;
